import React, { useState } from 'react';
import { TextField, Box, Typography } from '@mui/material';
import FormComponent4 from '../BscNursing4YDCForms/FormComponent4';

const subjectsData = [
  {
    title: "ENGL 101 Communicative English",
    credits: 2,
    maxIA: 25,
    maxSE: 25,
    marksIA: 20,
    marksSE: 22,
    percentage: "84%",
    grade: "A",
    gradePoint: 8,
    creditPoints: 16,
    result: "Pass",
  },
  {
    title: "ANAT 105 & PHYS 110 Applied Anotomy &Applied Physiology",
    credits: 6,
    maxIA: 25,
    maxSE: 75,
    marksIA: 23,
    marksSE: 70,
    percentage: "93%",
    grade: "A+",
    gradePoint: 9,
    creditPoints: 54,
    result: "Pass",
  },
  {
    title: "SOCI 115 & PHYSC 120 Applied sociology & Applied Psychology",
    credits: 6,
    maxIA: 30,
    maxSE: 75,
    marksIA: 28,
    marksSE: 70,
    percentage: "94%",
    grade: "A+",
    gradePoint: 9,
    creditPoints: 54,
    result: "Pass",
  }
];

const NursingSemester1 = () => {
  const [studentId, setStudentId] = useState('');
  const [course, setCourse] = useState('');
  const [department, setDepartment] = useState('');
  const [year, setYear] = useState('');
  const [semester, setSemester] = useState('');

  return (
    <Box sx={{ px: 6, py: 4 }}>
      <Typography variant="h6" gutterBottom>
        Enter Student Details
      </Typography>

      <Box sx={{ display: 'flex', flexWrap: 'wrap', gap: 2, mb: 4 }}>
        <TextField
          label="Student ID"
          value={studentId}
          onChange={(e) => setStudentId(e.target.value)}
        />
        <TextField
          label="Course"
          value={course}
          onChange={(e) => setCourse(e.target.value)}
        />
        <TextField
          label="Department"
          value={department}
          onChange={(e) => setDepartment(e.target.value)}
        />
        <TextField
          label="Year"
          value={year}
          onChange={(e) => setYear(e.target.value)}
        />
        <TextField
          label="Semester"
          value={semester}
          onChange={(e) => setSemester(e.target.value)}
        />
      </Box>

      {studentId && course && department && year && semester && (
        <FormComponent4
          title="First Year B.Sc. Nursing Marks Memo"
          subjectsData={subjectsData}
          idLabel="Student ID:"
          rollNumber={studentId}
          name={course}
          sod={department}
          examDate={`${year} - Semester ${semester}`}
          sgpa="8.9"
        />
      )}
    </Box>
  );
};

export default NursingSemester1;
